#import "WSRenderStyle.h"
#import "OpenPATHEngine.h"
#import "WOSCore/OpenPATHCore.h"


@implementation WSRenderStyle

- (id) init {
    self = [super init];

    if (self) {
        RenderStyleDAO*  dao = [RenderStyleDAO new];

        ResdbResult* result = [dao retrieve:WS_ROOT_OBJECT_IDENTIFIER];

        if (result.resdbCode == RESDB_SQL_ROWS) {
             renderStyle_ = (RenderStyle*)result.resdbObject;
        } else {
            renderStyle_ = [RenderStyle new];

            renderStyle_.objectID            = WS_ROOT_OBJECT_IDENTIFIER;

            renderStyle_.textColor           = @"003767";
            renderStyle_.textFontSize        = @"22";
            renderStyle_.textFontFamily      = @"Bryant-Bold";
            renderStyle_.questionColor       = @"0E2A52";
            renderStyle_.questionFontSize    = @"22";
            renderStyle_.questionFontFamily  = @"Bryant-Bold";
            renderStyle_.headerColor         = @"003767";
            renderStyle_.headerFontSize      = @"29";
            renderStyle_.headerFontFamily    = @"Bryant-Bold";
            renderStyle_.choiceTextColor     = @"003767";;
            renderStyle_.choiceFontSize      = @"22";
            renderStyle_.choiceFontFamily    = @"Bryant-Bold";
            renderStyle_.responseBorderColor = @"FF0000";
            renderStyle_.backgroundColor     = @"";
            renderStyle_.separatorColor      = @"FF0000";
            renderStyle_.nextButtonText      = @"Next";
            renderStyle_.previousButtonText  = @"Previous";
            renderStyle_.homeButtonText      = @"Home";

            [dao insert: renderStyle_];
        }

    }

    return self;
}

- (id) initWithRenderStyle: (RenderStyle*) renderStyle {
    self = [super init];

    if (self) {
        renderStyle_ = renderStyle;
    }

    return self;
}

- (RenderStyle*)renderStyle {
    return renderStyle_;
}


@end